function Set(e){this._hashFunction=e||JSON.stringify;this._values={};this._size=0}Set.prototype={add:function(t){if(!this.contains(t)){this._values[this._hashFunction(t)]=t;this._size++}},remove:function(t){if(this.contains(t)){delete this._values[this._hashFunction(t)];this._size--}},contains:function(t){return typeof this._values[this._hashFunction(t)]!=="undefined"},size:function(){return this._size},each:function(t,n){for(var r in this._values){t.call(n,this._values[r])}}}